/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trig_tbl_accomplishment_detail_before_update` BEFORE UPDATE ON `tbl_accomplishment_detail` FOR EACH ROW
	BEGIN

		--	GET THE SUM OF THE NUMERATOR
		SET NEW.a_numerator =	  NEW.a_numerator_qtr1
								+ NEW.a_numerator_qtr2
								+ NEW.a_numerator_qtr3
								+ NEW.a_numerator_qtr4;
								
		IF NEW.a_numerator = 0 THEN
			SET NEW.a_numerator = NULL;
		END IF;

		--	SET THE DENOMINATOR TO 1 IF THE VALUE BEING ASKED IS A NUMBER
		IF     (NEW.pi < 7 AND NEW.pi_no = 1) 
			OR (NEW.pi = 4 AND NEW.pi_no = 2) 
			OR (NEW.pi = 5 AND NEW.pi_no < 1 AND NEW.pi_no > 6) 
			OR (NEW.pi = 5 AND NEW.pi_no = 11) THEN
			--	SET THE DENOMINATOR TO 1
			SET NEW.a_denominator = 1;
			SET NEW.a_denominator_qtr1 = 1;
			SET NEW.a_denominator_qtr2 = 0;
			SET NEW.a_denominator_qtr3 = 0;
			SET NEW.a_denominator_qtr4 = 0;
			--	IF NUMERATOR IS NOT NULL
			IF NEW.a_numerator IS NOT NULL THEN
				SET NEW.accomplishment = (NEW.a_numerator / NEW.a_denominator);
			ELSE
				SET NEW.accomplishment = NULL;
			END IF;
		--	COMPUTE THE DENOMINATOR IF THE VALUE BEING ASKED IS A PERCENTAGE
		ELSE		
			--	GET THE SUM OF THE DENOMINATOR 
			SET NEW.a_denominator =   NEW.a_denominator_qtr1
								+ NEW.a_denominator_qtr2
								+ NEW.a_denominator_qtr3
								+ NEW.a_denominator_qtr4;
			--	IF NUMERATOR IS NOT NULL AND DENOMINATOR NOT 0 THEN COMPUTE FOR THE ACCOMPLISHMENT
			IF NEW.a_numerator IS NOT NULL AND NEW.a_denominator <> 0 THEN
				SET NEW.accomplishment = (NEW.a_numerator / NEW.a_denominator) * 100;
			ELSE
				SET NEW.a_denominator = NULL;
				SET NEW.accomplishment = NULL;
			END IF;
			
		END IF;

		--	IF ACCOMPLISHMENT IS NOT NULL THEN COMPUTE FOR THE PERFORMANCE RATING - WORKS IF THE USER IS THE UNIT, HOW ABOUT THE CU 
		IF NEW.accomplishment IS NOT NULL THEN
			SET NEW.above_90 = (NEW.accomplishment / NEW.target) * 100;
		ELSE
			SET NEW.above_90 = NULL;
		END IF;

		--	TEST IF THE PERFORMANCE RATING IS GREATER THAN OR EQUAL TO 90 THEN ASSIGN TO THE PROPER COLUMNS
		IF NEW.above_90 < 90 THEN
			SET NEW.below_90 = NEW.above_90;
			SET NEW.above_90 = NULL;
		ELSE 
			SET NEW.below_90 = NULL;
		END IF;

	END */;;
